import background from './assets/home-background.png';
import Navbar from './components/Navbar.js';
import './App.css';

function App() {
  return (
    <div className="App">
        <Navbar/>
        <div className="landing-background-image-container">
          <img src={background} className="landing-background-image" alt="logo" />
          <div className="landing-background-text">About</div>
        </div>
        <div>
        </div>
    </div>
  );
}

export default App;
